function submitSubscribe(){var e=$("#subscribe-nome").val(),s=$("#subscribe-email").val();$.ajax({type:"POST",url:"./contato/subscribe/subscribe.php",data:"subscribe-nome="+e+"&subscribe-email="+s,success:function(e){"success"==e?subscribeSuccess():subscribeError()}})}function subscribeSuccess(){$("#etka_subscribe-enviado").removeClass("etka_subscribe-enviado"),$("#subscribe-nome, #subscribe-email").val("")}function subscribeError(){$("#etka_subscribe-erro").removeClass("etka_subscribe-erro")}$("#etka_subscribe").submit(function(e){var s=document.forms.etka_subscribe["subscribe-email"].value,b=document.getElementById("subscribe-email"),r=document.createAttribute("required");if(""==s)return b.setAttributeNode(r),!1;e.isDefaultPrevented()?subscribeError():(e.preventDefault(),submitSubscribe())});